import React, { Component } from 'react'
import Button from './button'

export default class navBar extends Component {
    constructor(props){
        super(props)
    }
  render() { 
      var pageList = this.props.pages.map(name => <button className='btn btn-primary btn-sm rounded list-inline-item'>{name}</button>)
      console.log(pageList);
    return (
      <nav className='navbar fixed-top navbar-dark bg-dark'>
        <div className='container-fluid justify-content-center'>
            <li className='nav list-inline'>
                {
                    this.props.pages.map(name => <button className='btn btn-primary btn-sm rounded list-inline-item'>{name}</button>)
                }
            </li>
            
        </div>
      </nav>
    )
  }
}
